import { IonButton, IonModal } from "@ionic/react";
import { Button, Card, Col, Row } from "react-bootstrap";
import { useDispatch, useSelector } from "react-redux";
import FormLogin from "./FormLogin";


const ModalConfirm = () => {

  const {feha_nac='',number_phone='',puesto=''} = useSelector((state: any) => state.userInfo);
    const { statusModal = false } = useSelector((state: any) => state.effects);
    const dispatch = useDispatch();

    return <IonModal
        isOpen={statusModal}
        swipeToClose={false}
        backdropDismiss={false}
        onDidDismiss={() => dispatch({ type: 'OFF_MODAL' })}        
    >
        <hr/>
        <Card.Title style={{padding:'10px 40px'}}> Confirmar datos:</Card.Title>

        <hr />
        <Card.Body>
            <Row>
                <Col sm={12}>
                    <FormLogin />                   
                </Col>
                <Col sm={12}>
                    <FormLogin />
                </Col>
                <Col sm={6}></Col>
                <Col sm={6}>
                    <IonButton expand='block' >GUARDAR</IonButton>
                </Col>
            </Row>
        </Card.Body>
    </IonModal>;
}

export default ModalConfirm;
